import React from "react";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faTrashCan } from "@fortawesome/free-solid-svg-icons";


function Note(props){
    return (
        <div className="note">
            <h1>{props.title}</h1>
            <p>{props.content}</p>
            <button>Delete</button>
            <FontAwesomeIcon icon="fa-solid fa-trash-can" icon={faTrashCan}/>
        </div>
    )
}

export default Note;
